import React, { useState, useEffect } from 'react';
import { FaEnvelope, FaEye, FaTrash, FaClock, FaUser, FaCheck, FaSpinner } from 'react-icons/fa';
import Layout from '../components/layout/Layout';
import PageHeader from '../components/common/PageHeader';
import { enquiryApi } from '../services/api';

const Enquiries = () => {
  const [enquiries, setEnquiries] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    fetchEnquiries();
  }, []);

  const fetchEnquiries = async () => {
    try {
      const response = await enquiryApi.getAll();
      setEnquiries(response.data?.data || []);
    } catch (error) {
      setError('Failed to fetch enquiries');
      console.error('Error fetching enquiries:', error);
    } finally {
      setLoading(false);
    }
  };

  const getStatusIcon = (status) => {
    switch (status?.toLowerCase()) {
      case 'resolved':
        return <FaCheck className="h-4 w-4 text-green-500" />;
      case 'in-progress':
        return <FaSpinner className="h-4 w-4 text-blue-500 animate-spin" />;
      default:
        return <FaEnvelope className="h-4 w-4 text-yellow-500" />;
    }
  };

  const getStatusColor = (status) => {
    switch (status?.toLowerCase()) {
      case 'resolved':
        return 'bg-green-100 text-green-800';
      case 'in-progress':
        return 'bg-blue-100 text-blue-800';
      default:
        return 'bg-yellow-100 text-yellow-800';
    }
  };

  if (loading) {
    return (
      <Layout>
        <div className="flex items-center justify-center min-h-screen">
          <div className="loading-spinner" />
        </div>
      </Layout>
    );
  }

  if (error) {
    return (
      <Layout>
        <div className="p-4">
          <div className="bg-red-50 text-red-700 p-4 rounded-lg">
            {error}
          </div>
        </div>
      </Layout>
    );
  }

  return (
    <Layout>
      <PageHeader
        title="Enquiries"
        description="Manage customer enquiries and requests"
      />

      <div className="space-y-6">
        {enquiries.map((enquiry) => (
          <div key={enquiry.id} className="bg-white rounded-lg shadow-sm overflow-hidden">
            <div className="p-6">
              <div className="flex items-start justify-between">
                <div className="flex items-start space-x-4">
                  <div className="flex-shrink-0">
                    <div className="h-10 w-10 bg-purple-100 rounded-lg flex items-center justify-center">
                      {getStatusIcon(enquiry.status)}
                    </div>
                  </div>
                  <div>
                    <h3 className="text-lg font-medium text-gray-900">
                      {enquiry.subject || 'General Enquiry'}
                    </h3>
                    <div className="mt-1 flex items-center space-x-4 text-sm text-gray-500">
                      <div className="flex items-center">
                        <FaUser className="h-4 w-4 mr-1" />
                        {enquiry.name}
                      </div>
                      <div className="flex items-center">
                        <FaClock className="h-4 w-4 mr-1" />
                        {new Date(enquiry.created_at).toLocaleDateString()}
                      </div>
                    </div>
                    <div className="mt-2 text-sm text-gray-600">
                      <p>{enquiry.message}</p>
                    </div>
                    {enquiry.email && (
                      <div className="mt-2 text-sm text-gray-500">
                        Email: {enquiry.email}
                      </div>
                    )}
                    {enquiry.phone && (
                      <div className="mt-1 text-sm text-gray-500">
                        Phone: {enquiry.phone}
                      </div>
                    )}
                  </div>
                </div>
                <div className="flex items-start space-x-3">
                  <span className={`inline-flex items-center px-2.5 py-0.5 rounded-full text-xs font-medium ${getStatusColor(enquiry.status)}`}>
                    {enquiry.status || 'Pending'}
                  </span>
                  <div className="flex items-center space-x-2">
                    <button className="btn btn-sm btn-secondary">
                      <FaEye className="h-4 w-4" />
                    </button>
                    <button className="btn btn-sm btn-danger">
                      <FaTrash className="h-4 w-4" />
                    </button>
                  </div>
                </div>
              </div>
            </div>
          </div>
        ))}

        {enquiries.length === 0 && (
          <div className="text-center py-12 bg-white rounded-lg shadow-sm">
            <FaEnvelope className="mx-auto h-12 w-12 text-gray-400" />
            <h3 className="mt-2 text-sm font-medium text-gray-900">No enquiries</h3>
            <p className="mt-1 text-sm text-gray-500">No customer enquiries have been received yet.</p>
          </div>
        )}
      </div>
    </Layout>
  );
};

export default Enquiries;
